import React from 'react';
import s from './myPosts.module.css';

function MyPosts() {
  return (
    <div>
      <div>
        My Posts
      </div>
      <div>
        New Post
      </div>
      <div className={s.posts}>
        <div className={s.item}>
          post 1
        </div>
        <div className={s.item}>
          post 2
        </div>
      </div>
    </div>
  );
}

export default MyPosts;
